B.P5=new A.x("10. Datenschutzbestimmungen zu Einsatz und Verwendung von Instagram",null,null,null,null,null,null,null)
B.Q_=new A.x("Der f\xfcr die Verarbeitung Verantwortliche hat auf dieser Internetseite Komponenten des Dienstes Instagram integriert. Instagram ist ein Dienst, der als audiovisuelle Plattform zu qualifizieren ist und den Nutzern das Teilen von Fotos und Videos und zudem eine Weiterverbreitung solcher Daten in anderen sozialen Netzwerken erm\xf6glicht.",null,null,null,null,null,null,null)
