B.Rv=new A.x("Durch jeden Aufruf einer der Einzelseiten dieser Internetseite, die durch den f\xfcr die Verarbeitung Verantwortlichen betrieben wird und auf welcher eine Instagram-Komponente (Insta-Button) integriert wurde, wird der Internetbrowser auf dem informationstechnologischen System der betroffenen Person automatisch durch die jeweilige Instagram-Komponente veranlasst, eine Darstellung der entsprechenden Komponente von Instagram herunterzuladen. Im Rahmen dieses technischen Verfahrens erh\xe4lt Instagram Kenntnis dar\xfcber, welche konkrete Unterseite unserer Internetseite durch die betroffene Person besucht wird.",null,null,null,null,null,null,null)
B.Q7=new A.x("Sofern die betroffene Person gleichzeitig bei Instagram eingeloggt ist, erkennt Instagram mit jedem Aufruf unserer Internetseite durch die betroffene Person und w\xe4hrend der gesamten Dauer des jeweiligen Aufenthaltes auf unserer Internetseite, welche konkrete Unterseite die betroffene Person besucht. Diese Informationen werden durch die Instagram-Komponente gesammelt und durch Instagram dem jeweiligen Instagram-Account der betroffenen Person zugeordnet. Bet\xe4tigt die betroffene Person einen der auf unserer Internetseite integrierten Instagram-Buttons, werden die damit \xfcbertragenen Daten und Informationen dem pers\xf6nlichen Instagram-Benutzerkonto der betroffenen Person zugeordnet und von Instagram gespeichert und verarbeitet.",null,null,null,null,null,null,null)
B.PK=new A.x("Instagram erh\xe4lt \xfcber die Instagram-Komponente immer dann eine Information dar\xfcber, dass die betroffene Person unsere Internetseite besucht hat, wenn die betroffene Person zum Zeitpunkt des Aufrufs unserer Internetseite gleichzeitig bei Instagram eingeloggt ist; dies findet unabh\xe4ngig davon statt, ob die betroffene Person die Instagram-Komponente anklickt oder nicht. Ist eine derartige \xdcbermittlung dieser Informationen an Instagram von der betroffenen Person nicht gewollt, kann diese die \xdcbermittlung dadurch verhindern, dass sie sich vor einem Aufruf unserer Internetseite aus ihrem Instagram-Account ausloggt.",null,null,null,null,null,null,null)
