B.R2=new A.x("Der f\xfcr die Verarbeitung Verantwortliche hat auf dieser Internetseite Komponenten von PayPal integriert. PayPal ist ein Online-Zahlungsdienstleister. Zahlungen werden \xfcber sogenannte PayPal-Konten abgewickelt, die virtuelle Privat- oder Gesch\xe4ftskonten darstellen. Zudem besteht bei PayPal die M\xf6glichkeit, virtuelle Zahlungen \xfcber Kreditkarten abzuwickeln, wenn ein Nutzer kein PayPal-Konto unterh\xe4lt. Ein PayPal-Konto wird \xfcber eine E-Mail-Adresse gef\xfchrt, weshalb es keine klassische Kontonummer gibt. PayPal erm\xf6glicht es, Online-Zahlungen an Dritte auszul\xf6sen oder auch Zahlungen zu empfangen. PayPal \xfcbernimmt ferner Treuh\xe4nderfunktionen und bietet K\xe4uferschutzdienste an.",null,null,null,null,null,null,null)
B.Qx=new A.x("Die Europ\xe4ische Betreibergesellschaft von PayPal ist die PayPal (Europe) S.\xe0.r.l. et Cie, S.C.A., 22-24 Boulevard Royal L-2449, Luxemburg.",null,null,null,null,null,null,null)
B.QP=new A.x("W\xe4hlt die betroffene Person w\xe4hrend des Bestellvorgangs in unserem Online-Shop als Zahlungsm\xf6glichkeit \u201ePayPal\u201c aus, werden automatisiert Daten der betroffenen Person an PayPal \xfcbermittelt. Mit der Auswahl dieser Zahlungsoption willigt die betroffene Person in die zur Zahlungsabwicklung erforderliche \xdcbermittlung personenbezogener Daten ein.",null,null,null,null,null,null,null)
B.Rr=new A.x("Bei den an PayPal \xfcbermittelten personenbezogenen Daten handelt es sich in der Regel um Vorname, Nachname, Adresse, Email-Adresse, IP-Adresse, Telefonnummer, Mobiltelefonnummer oder andere Daten, die zur Zahlungsabwicklung notwendig sind. Zur Abwicklung des Kaufvertrages notwendig sind auch solche personenbezogenen Daten, die im Zusammenhang mit der jeweiligen Bestellung stehen.",null,null,null,null,null,null,null)
B.Qh=new A.x("Die \xdcbermittlung der Daten bezweckt die Zahlungsabwicklung und die Betrugspr\xe4vention. Der f\xfcr die Verarbeitung Verantwortliche wird PayPal personenbezogene Daten insbesondere dann \xfcbermitteln, wenn ein berechtigtes Interesse f\xfcr die \xdcbermittlung gegeben ist. Die zwischen PayPal und dem f\xfcr die Verarbeitung Verantwortlichen ausgetauschten personenbezogenen Daten werden von PayPal unter Umst\xe4nden an Wirtschaftsauskunfteien \xfcbermittelt. Diese \xdcbermittlung bezweckt die Identit\xe4ts- und Bonit\xe4tspr\xfcfung.",null,null,null,null,null,null,null)
B.Qn=new A.x("PayPal gibt die personenbezogenen Daten gegebenenfalls an verbundene Unternehmen und Leistungserbringer oder Subunternehmer weiter, soweit dies zur Erf\xfcllung der vertraglichen Verpflichtungen erforderlich ist oder die Daten im Auftrag verarbeitet werden sollen.",null,null,null,null,null,null,null)
B.Ph=new A.x("Die betroffene Person hat die M\xf6glichkeit, die Einwilligung zum Umgang mit personenbezogenen Daten jederzeit gegen\xfcber PayPal zu widerrufen. Ein Widerruf wirkt sich nicht auf personenbezogene Daten aus, die zwingend zur (vertragsgem\xe4\xdfen) Zahlungsabwicklung verarbeitet, genutzt oder \xfcbermittelt werden m\xfcssen.",null,null,null,null,null,null,null)
